import React from 'react';

const Spinner = ({message}) => {
    return (
        <React.Fragment>
                <div className="ui active inverted dimmer">
                    <div className="ui large text loader fontify">Loading</div>
                </div>
            
        </React.Fragment>
    );
};
Spinner.defaultProps={
  message:"Loading"
};

export default Spinner;
